ISLAMABAD, Feb 9 (APP): Pakistan Muslim League PML(N) candidate Mian Shahid Hussain Khan won the Punjab Assembly elections from PP-37 Hafizabad- I by securing 59,853 votes.
According to the unofficial results, issued by the returning officer/ECP. his runner-up was an Independent candidate Chaudhary Muhammad Asad Ullah 41,800 votes. Votersâ€™ turn-out remained at 60.87 per cent.
